import logo from './logo.svg';
import './App.css';
import { BrowserRouter,Routes } from 'react-router';

function App() {
  return (
    <div className="App">
     <BrowserRouter> 
      <Routes>
        <Route path="/" element={<Home/>}/>
        <Route path="/about" element={<About/>}/>
        <Route path="/contact" element={<Contact/>}/>
        <Route path="*" element={<NoPage/>}/>
      </Routes>
     </BrowserRouter>
    </div>
  );
}

export default App;
